react-day-picker is a flexible date picker component for React.no external dependencies

select days, ranges, whatever using CSS modifiers

ready for i18n, with moment.js or any other library

customizable style

navigable via keyboard, ARIA support

Check out the examples to see its features.




Quick startInstall via npmnpm install react-day-picker --save
Install via Bowerbower install react-day-picker --save
The bower package exposes a global DayPicker variable.Exampleimport React from 'react';
import DayPicker, { DateUtils } from "react-day-picker";

function sunday(day) {
  return day.getDay() === 0;
}

class MyComponent extends React.Component {
  state = {
    selectedDay: new Date(),
  }
  handleDayClick(e, day, { selected, disabled }) {
    if (disabled) {
      return;
    }
    if (selected) {
      this.setState({ selectedDay: null })
    } else {
      this.setState({ selectedDay: day });
    }
  },
  render() {
    return (
       DateUtils.isSameDay(this.state.selectedDay, day) }
        onDayClick={ this.handleDayClick.bind(this) }
    />);
  }
}
See Basic usage for a deeper explanation of the example above.Docs and examplesExamples with code

