Basic usagereact-day-picker is designed to cover the most common needs for a date picker in a web application. This chapter illustrates the component's basic concepts by implementing a date picker to select, clear and disable days from the calendar.Selecting a dayreact-day-picker doesn't hold the selected day in its state. Instead, you have to get it when the user interacts with the calendar.The following component uses the onDayClick prop to save the clicked day in its own state:import React from 'react';
import DayPicker from 'react-day-picker';

class SelectDay extends React.Component {
  state = {
    // The default selected day is today
    selectedDay: new Date(),
  };
  handleDayClick(e, day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (



          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
Somewhere your CSS must set the appearance for the selected day, but first you need to tell the day picker which days have been selected.The selectedDays prop is a function that checks whether a day should get the selected CSS modifier:import React from 'react';
import DayPicker, { DateUtils } from 'react-day-picker';

class SelectDay extends React.Component {
  state = {
    // The default selected day is today
    selectedDay: new Date(),
  };
  handleDayClick(e, day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (

         DateUtils.isSameDay(day, this.state.selectedDay) }
        />

          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
Then, in your CSS, add a .DayPicker-Day--selected selector to highlight the cell corresponding to the selected day. For example:.DayPicker-Day--selected {
  background-color: red;
  color: white;
}
Note You can use the CSS contained in react-day-picker/lib/style.css, which contains a basic stylesheet. Read Styling to know how to properly style the component.Clearing the selected dayWhen a selected day is clicked again, we want to clear it. This can be made setting the component's selectedDay to null.The onDayClick handler receives as third argument a modifiers object that can be inspected if the clicked day has been selected or not:// snip
handleDayClick(e, day, modifiers) {
  if (modifiers.selected) {
    // unselect the day if already selected
    this.state({ selectedDay: null });
    return;
  }
  this.setState({ selectedDay: day });
}
That's all! See this example using the code above.Marking days as disabledDisabled days should not respond to the user's interaction and should appear as "disabled" on the calendar. Use the disabledDays prop to specify which days should be disabled.In the following example, we choose to disable every Sunday:import DayPicker from 'react-day-picker';

const isSunday = day => day.getDay() === 0;

