}
Then, style the day to appear as disabled in your CSS using the .DayPicker-Day--disabled selector:.DayPicker-Day--disabled {
  background-color: grey;
  color: white;
  cursor: pointer;
}
Preventing the user to select a disabled dayIn the previous example nothing happens when the user clicks on a day, since the onDayClick prop is missing. As before, we need to save the value of the selected day in our component's state:import DayPicker, { DateUtils } from 'react-day-picker';

const isSunday = day => day.getDay() === 0;

class SelectDay extends React.Component {
  state = {
    selectedDay: new Date(),
  };
  handleDayClick(e, day) {
    this.setState({ selectedDay: day });
  }
  render() {
    return (

         DateUtils.isSameDay(day, this.state.selectedDay) }
          onDayClick={ this.handleDayClick.bind(this) }
        />

          The selected day is { this.state.selectedDay.toLocaleDateString() }


    )
  }
}
This, however, will make selectable even the disabled days. We need instead our component to not update its state, in case the clicked day is disabled. In the click handler we can use the day's modifiers to check if the day was disabled:handleDayClick(e, day, modifiers) {
  if (modifiers.disabled) {
    // do not update the state if the day is disabled
    return;
  }
  this.setState({ selectedDay: day });
}
Check out this example shows a similar implementation.Next stepsThe selectedDays function and the onDayClick event handler can implement a more complex logic to make the date picker more powerful. For example, you can make the date picker to select a range of days.You can go deeper with your customization using modifiers. Modifiers are a powerful concept behind react-day-picker. Read more about them in the next chapter.

Modifiers.html.body:
Use of modifiersModifiers give you the full control over the appearance and the behavior of the date picker. You use modifiers to implement the different logic according to your data.Modifiers are named functions called when rendering a day cell. They take the day as first argument and return a boolean value. For example, these functions are valid modifiers:function isSunday(day) {
  return day.getDay() === 0;
}
function isFirstDayOfMonth(day) {
  return day.getDate() === 1;
}
You pass modifiers to the day picker using the modifiers prop:
selected and disabled modifiersUnder the hood, the selectedDays and disabledDays props set a selected and a disabled modifier. This code is the same:

Use modifiers to style the day cellsThe CSS class for a day cell will get the modifier (as in BEM-like syntax) when the corresponding function returns true for the given day.For example, using the modifiers above, any cell representing a Sunday will have the DayPicker-Day--isSunday class name, and the first day of the month will have a DayPicker-Day--isFirstDayOfMonth class name.Access modifiers from the event handlersModifiers are passed as argument to the event handlers:function handleDayClick(e, day, modifiers) {
  if (modifiers.isSunday) {
    console.log('Sunday has been clicked')
  }
}

function handleDayMouseEnter(e, day, { isFirstDayOfMonth }) {
  if (isFirstDayOfMonth) {
    console.log('The first day of month received mouse enter')
  }
}


Use DateUtils to create modifiersreact-day-picker includes DateUtils, a small function library useful to simplify the creation of modifiers.

