LocalizationMoment.html.body:
Localization with moment.jsTo localize the calendar with moment.js:make sure moment is included in your dependencies

make sure the required moment's locale data is available when rendering the day picker

import LocaleUtils from react-day-picker/moment and pass it to the localeUtils props

use the locale prop to pass the current locale

See an example.CodeThe following component shows four day pickers: English, Japanese, Arabic and Italian.
