DateUtils.html.body:
DateUtilsDateUtils is a set of functions useful to work with dates and modifiers.import { DateUtils } from "react-day-picker";
console.log(DateUtils.isPastDay(new Date())); // false
FunctionsaddMonths (d: Date, n: Number) â‡’ DateReturn d as a new date with n months added. Missing days will be added to the final date, e.g. 2016-03-31 + 1 month = 2016-05-01 (the 31th of April is missing).clone (d: Date) â‡’ DateClone the date d returning a new date with the same time.isSameDay (d1: ?Date, d2: ?Date) â‡’ BoolReturn true if the two dates d1 and d2 are the same day, e.g. ignoring their time.isPastDay (d: Date) â‡’ BoolReturns true if d is in the past, e.g. is yesterday or any day before yesterday.isDayBetween (day: Date, d1: Date, d2: Date) â‡’ BoolReturns true if day is between the days d1 and d2, without including those days.addDayToRange (day: Date, range: ?object) â‡’ ObjectAdd day to a range of days, returning a new range including that day. A range is an object with from and to keys.See the range example for an example using this function.import { DateUtils } from "react-day-picker";

const range = {
  from: new Date(2015, 5, 14),
  to: new Date(2015, 5, 18)
}
const newRange = DateUtils.addDayToRange(new Date(2015, 5, 24), range);

console.log(newRange.from) // 2015-05-24
isDayInRange (day: Date, range: object) â‡’ BoolReturns true if day is included in the specified range of days.  See the range example for an example using this function.

