LocaleUtilsLocaleUtils is a set of functions used to localize the component (see: Custom localization). You may want to implement your own LocaleUtils, or override some of its functions.For example, this code renders the month's title as M/YYYY instead of the default:import DayPicker, { LocaleUtils } from "react-day-picker";

function formatMonthTitle(d, locale) {
 return `${d.getMonth() + 1}/${d.getFullYear}`
}



FunctionsformatDay (d: Date, locale: String) â‡’ StringFormat the string used as aria-label for the given day.formatMonthTitle (d: Date, locale: String) â‡’ StringReturn the string used to format the month's title in the day picker for the given date d.formatWeekdayShort (i: number, locale: String) â‡’ StringReturn the string used to render the weekday's short name, e.g. Mo for Monday.formatWeekdayLong (i: number, locale: String) â‡’ StringReturn the string used to render the weekday's long name, e.g. Monday. It is used mainly for ARIA.getFirstDayOfWeek (locale: String) â‡’ NumberReturn the first day of the week for the given locale, e.g. 0 (Sunday) when locale is en.getMonths (locale: String) â‡’ ArrayReturn the twelve months for the given locale (full name, e.g. January).
